import { Route, Routes } from 'react-router-dom';
import Navbar from './Component/Navbar';
import './Style/App.scss';
import SlideRecord from './Pages/SlideRecord';
import SpeedSlalomRecord from './Pages/SpeedSlalomRecord';
import Home from './Pages/Home';

const App = () => {
  return (
    <div className='App'>
        <Navbar />
      <main>
        <div className='Container'>
          <p>Training Recoord</p>
          <Routes>
            <Route path="/Componnent/Home" element={<Home />} />
            <Route path="/Componnent/SlideRecord" element={<SlideRecord />} />
            <Route path="/Componnent/SpeedSlalomRecord" element={<SpeedSlalomRecord />} />
          </Routes>
        </div>
      </main>
    </div>
  );
};

export default App;
